import API from '../API';
import { useEffect, useState } from 'react';
import { Button, Spacer, CallFilled } from '@aircall/tractor';

import AppStyling from '../AppStyling';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(AppStyling);

const CallList = ({ token, page }) => {
  const classes = useStyles();

  useEffect(() => {
    API.getCalls(token, page)
      .then(resp => resp.json())
      .then(data => console.log(data));
  });

  return (
    <Spacer space="s" width="400px !important" direction="vertical">
      <Button block>
        <CallFilled /> Left icon
      </Button>
      <Button block>Yes please</Button>
      <Button variant="destructive" block>
        Yes please
      </Button>
      <Button variant="instructive" block>
        Yes please
      </Button>
      <Button variant="warning" block>
        Yes please
      </Button>
      <Button disabled block>
        Yes please
      </Button>
    </Spacer>
  );
};

export default CallList;
